import React from 'react';
import { NavLink } from 'react-router-dom';

const Banner = () => (
  <nav className="banner">
    <ul>
      <li>
    <NavLink to="/">Posts</NavLink>
    </li>
    <li>
    <NavLink to="/contact">Contact</NavLink>
    </li>
    </ul>
  </nav>
);

export default Banner;
